import { Button, ButtonGroup } from "react-bootstrap";

const Menus = () => {
  return (
    <ButtonGroup>
      <Button className="mx-2">Button 1</Button>
      <Button className="mx-2">Button 2</Button>
      <Button>Button 3</Button>
    </ButtonGroup>
  );
};

export default Menus;
